import React from "react";

const Project = ({ name, description, githubUrl }) => {
  return (
    <div className="project">
      <h3>{name}</h3>
      <p>{description}</p>
      <a href={githubUrl}>View on GitHub</a>
    </div>
  );
};

export default Project;
